import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Chart from 'chart.js/auto'; // Import Chart.js library
import Header from '../components/header'; // Import Header component
import Footer from '../components/footer'; // Import Footer component

const Home = () => {
  const [orderStatusCounts, setOrderStatusCounts] = useState({});
  const [incomeData, setIncomeData] = useState([]);
  const [ordersPerDayData, setOrdersPerDayData] = useState([]);
  const [servicesAvailedData, setServicesAvailedData] = useState([]);
  const [incomeChart, setIncomeChart] = useState(null);
  const [ordersPerDayChart, setOrdersPerDayChart] = useState(null);
  const [servicesAvailedChart, setServicesAvailedChart] = useState(null);

  useEffect(() => {
    // Fetch data for order status counts
    axios.get('http://localhost:3000/order/statusCounts')
      .then(response => {
        setOrderStatusCounts(response.data);
      })
      .catch(error => {
        console.error("Error fetching order status counts:", error);
      });

    // Fetch data for income
    axios.get("http://localhost:3000/order/income")
      .then(response => {
        setIncomeData(response.data);
      })
      .catch(error => {
        console.error("Error fetching income data:", error);
      });

    // Fetch data for orders per day in a week
    axios.get("http://localhost:3000/order/orderPerDay")
      .then(response => {
        setOrdersPerDayData(response.data);
      })
      .catch(error => {
        console.error("Error fetching orders per day data:", error);
      });

    // Fetch data for services availed
    axios.get("http://localhost:3000/order/servicesAvailed")
      .then(response => {
        setServicesAvailedData(response.data);
      })
      .catch(error => {
        console.error("Error fetching services availed data:", error);
      });

  }, []);

  useEffect(() => {
    if (incomeData.length > 0) {
      if (incomeChart) {
        incomeChart.destroy();
      }
      const incomeChartCtx = document.getElementById('incomeChart').getContext('2d');
      const currentYear = new Date().getFullYear();

      // Fill in missing months with zero values
      const filledIncomeData = fillMissingMonths(incomeData);

      setIncomeChart(new Chart(incomeChartCtx, {
        type: 'line',
        data: {
          labels: filledIncomeData.map(data => {
            // Format the month from the database with abbreviation
            const date = new Date(`${data.year}-${data.month}-01`);
            return date.toLocaleString('default', { month: 'short' });
          }),
          datasets: [{
            label: 'Income',
            data: filledIncomeData.map(data => data.totalAmount), // Total amount data
            borderColor: 'blue',
            backgroundColor: 'rgba(0, 0, 255, 0.1)', // Background color for area under the line
            borderWidth: 1
          }]
        },
        options: {
          scales: {
            y: {
              beginAtZero: true
            }
          },
          plugins: {
            title: {
              display: true,
              padding: { bottom: 0 }
            },
            subtitle: {
              display: true,
              text: `Year: ${currentYear}`, // Display the current year
              padding: { top: 10 }
            }
          }
        }
      }));
    }

    if (servicesAvailedData.length > 0) {
      if (servicesAvailedChart) {
        servicesAvailedChart.destroy();
      }
      const servicesAvailedChartCtx = document.getElementById('servicesAvailedChart').getContext('2d');
      const serviceLabels = servicesAvailedData.map(data => data.serviceAvailed);
      const serviceCounts = servicesAvailedData.map(data => data.count);

      setServicesAvailedChart(new Chart(servicesAvailedChartCtx, {
        type: 'pie',
        data: {
          labels: serviceLabels,
          datasets: [{
            label: 'Number of Orders',
            data: serviceCounts,
            backgroundColor: ['green', 'blue', 'orange'], // Colors for each service
            borderWidth: 1
          }]
        },
        options: {
          plugins: {
            title: {
              display: true,
              text: 'Services Availed',
              padding: { bottom: 20 }
            }
          }
        }
      }));
    }

    if (ordersPerDayData.length > 0) {
      if (ordersPerDayChart) {
        ordersPerDayChart.destroy();
      }
      const ordersPerDayChartCtx = document.getElementById('ordersPerDayChart').getContext('2d');
      
      setOrdersPerDayChart(new Chart(ordersPerDayChartCtx, {
        type: 'bar',
        data: {
          labels: ordersPerDayData.map(data => data.day),
          datasets: [{
            label: 'Orders per Day',
            data: ordersPerDayData.map(data => data.count),
            backgroundColor: 'green',
            borderWidth: 1
          }]
        },
        options: {
          scales: {
            y: {
              beginAtZero: true
            }
          },
          plugins: {
            title: {
              display: true,
              text: 'Orders per Day',
              padding: { bottom: 20 }
            }
          }
        }
      }));
    }
  }, [incomeData, ordersPerDayData, servicesAvailedData]);

  // Function to fill missing months with zero values
  const fillMissingMonths = (data) => {
    const filledData = [];
    const currentYear = new Date().getFullYear();
    for (let month = 1; month <= 12; month++) {
      const existingData = data.find(item => item.year === currentYear && item.month === month);
      if (existingData) {
        filledData.push(existingData);
      } else {
        filledData.push({ year: currentYear, month, totalAmount: 0 });
      }
    }
    return filledData;
  };

  return (
    <div>
      <Header /> {/* Include Header component */}
      <div>
        <div className="jumbotron text-center">
          <br/><br/>
          <h1>Welcome to Our Website</h1>
          <p>We provide top-notch laundry services</p>
          <a href="/labaduh/order/new" className="btn btn-primary btn-lg">Place an Order</a>
        </div>
    
        <div className="container">
          <br />
          <br />
          <br />
          

          <div className="row">
            <div className="col-md-6">
              <div className="chart-container">
                <h2 className="text-center">Income</h2>
                <canvas id="incomeChart"></canvas>
              </div>
            </div>
            <div className="col-md-6">
              <div className="chart-container">
                <h2 className="text-center">Orders per Day</h2>
                <canvas id="ordersPerDayChart"></canvas>
              </div>
            </div>
          </div>
        </div>
      </div>
      <div className="col-md-6">
          <div className="chart-container">
              <h2 className="text-center">Services Availed</h2>
              <canvas id="servicesAvailedChart"></canvas>
          </div>
      </div>

      <div className="row">
            <div className="col-md-4">
              <div className="card">
                <div className="card-body">
                  <h5 className="card-title">Pending Orders</h5>
                  <p className="card-text">{orderStatusCounts.pending || 0}</p>
                </div>
              </div>
            </div>
            <div className="col-md-4">
              <div className="card">
                <div className="card-body">
                  <h5 className="card-title">Orders Ready for Pickup</h5>
                  <p className="card-text">{orderStatusCounts['ready for pick-up'] || 0}</p>
                </div>
              </div>
            </div>
            <div className="col-md-4">
              <div className="card">
                <div className="card-body">
                  <h5 className="card-title">Picked-up Orders</h5>
                  <p className="card-text">{orderStatusCounts['picked-up'] || 0}</p>
                </div>
              </div>
            </div>
          </div>
      <Footer /> {/* Include Footer component */}
    </div>
  );
};

export default Home;
